(19, 0, 0, 0, '650655730114211.jpg', 0, '650655730114211_160x120.jpg', 'asdsd', 'nina.vn', 0, 1, 1, 'doitac', '', '0', '0', '0', '0'),
(20, 0, 0, 0, '234945121328486.jpg', 0, '234945121328486_160x114.7346427079.jpg', 'ASAs', 'nina.vn', 0, 1, 1, 'doitac', '<p class="Normal"><span style="line-height: 1.5;">Ti chung kt gii U22 &ocirc;ng Nam &Aacute; din ra ti Brunei ng&agrave;y 23/8, U19 Vit Nam &atilde; tht bi 3-4 trc U19 Myanmar. Ch cha y na th&aacute;ng sau tht bi k tr&ecirc;n, U19 Vit Nam c&oacute; c hi "thanh to&aacute;n n" khi t&aacute;i ng U19 Myanmar ti b&aacute;n kt gii U19 &ocirc;ng Nam &Aacute; h&ocirc;m nay 11/9. Ln n&agrave;y, thy tr&ograve; HLV Graechen kh&ocirc;ng c&ograve;n phi chu thit th&ograve;i v mt th lc khi c&oacute; s trn tng ng vi i th. H c&ograve;n c&oacute; li th ln khi c chi tr&ecirc;n s&acirc;n nh&agrave;.</span></p>\r\n<p class="Normal">"Vn  l&uacute;c n&agrave;y ch l&agrave; cu th s nhp cuc vi tinh thn th n&agrave;o. T&ocirc;i &atilde; n&oacute;i vi h h&atilde;y &aacute; t tin nh khi i u U19 Nht Bn. Kh&ocirc;ng c&oacute; g&igrave; phi qu&aacute; e d&egrave; U19 Myanmar, U19 Vit Nam kh&ocirc;ng tri hn hn nhng cng kh&ocirc;ng h k&eacute;m hn h", HLV Graechen ph&aacute;t biu trc trn u.</p>\r\n<p class="Normal">&nbsp;</p>', '0', '0', '<p>0</p>', '<p>0</p>'),
(21, 0, 0, 0, '949135590685420.jpg', 0, '949135590685420_160x118.13333333333.jpg', 'ASAs', 'nina.vn', 0, 1, 1, 'doitac', '<p class="Normal"><span style="line-height: 1.5;">U19 Myanmar ang c&oacute; phong  tt. Sau khi v&ocirc; ch gii U22 &ocirc;ng Nam &Aacute;, o&agrave;n qu&acirc;n ca HLV Gerd Zeise &atilde; li&ecirc;n tip &aacute;nh bi U19 Th&aacute;i Lan (2-1) v&agrave; U19 Indonesia (3-0)  gi&agrave;nh s&aacute;u im tuyt i, chim ng&ocirc;i u bng A gii U19 &ocirc;ng Nam &Aacute;.&nbsp;</span></p>\r\n<p class="Normal">i th rt mnh nhng HLV Graechen cho bit &ocirc;ng s kh&ocirc;ng thay i c&aacute;ch chi, vn s cho c&aacute;c hc tr&ograve; &aacute; nh trn chung kt gii U22 &ocirc;ng Nam &Aacute; ti Brunei, ch ng tn c&ocirc;ng, &aacute;p t th trn ngay sau ting c&ograve;i khai cuc.</p>', '0', '0', '<p>0</p>', '<p>0</p>'),
(22, 0, 0, 0, '453348225834036.jpg', 0, '453348225834036_160x113.09589041096.jpg', 'Sa', 'asas', 0, 1, 1, 'doitac', '<p class="Normal">Bc v&agrave;o trn b&aacute;n kt vi U19 Myanmar, U19 Vit Nam c&oacute; c lc lng tt nht. B &ocirc;i hu v Trn Hu &ocirc;ng Triu v&agrave; L&ecirc; Vn Sn u &atilde; ho&agrave;n to&agrave;n b&igrave;nh phc chn thng v&agrave; chc chn s c&oacute; mt trong i h&igrave;nh xut ph&aacute;t.</p>\r\n<p class="Normal">Ti chung kt gii U22 &ocirc;ng Nam &Aacute; din ra ti Brunei ng&agrave;y 23/8, U19 Vit Nam &atilde; tht bi 3-4 trc U19 Myanmar. Ch cha y na th&aacute;ng sau tht bi k tr&ecirc;n, U19 Vit Nam c&oacute; c hi "thanh to&aacute;n n" khi t&aacute;i ng U19 Myanmar ti b&aacute;n kt gii U19 &ocirc;ng Nam &Aacute; h&ocirc;m nay 11/9. Ln n&agrave;y, thy tr&ograve; HLV Graechen kh&ocirc;ng c&ograve;n phi chu thit th&ograve;i v mt th lc khi c&oacute; s trn tng ng vi i th. H c&ograve;n c&oacute; li th ln khi c chi tr&ecirc;n s&acirc;n nh&agrave;.</p>', '0asd', 'as', '<p>0</p>', '<p>asasas</p>'),
(24, 0, 0, 0, '948552699790320.jpg', 0, '948552699790320_82x70.jpg', 'sss', '', 0, 0, 1, 'doitac', '<p>sssss</p>', '', '', '', '');
