(17, 0, 0, 'Nh Ph p', '', 'nha-pho-dep', '', '', '<p><strong style="text-align: right; font-size: 12px; line-height: 1.5;">Ch&uacute;ng t&ocirc;i dch v Sa cha, lp t h thng in d&acirc;n dng ti nh&agrave; chuy&ecirc;n nghip, bo h&agrave;nh d&agrave;i hn (C&oacute; th c&oacute; hoc kh&ocirc;ng c&oacute; bn v c&ocirc;ng tr&igrave;nh k&egrave;m theo):</strong></p>\r\n<p>- Sa cha, lp t h thng in d&acirc;n dng, h thng nc.</p>\r\n<p>- Sa cha lp t c&aacute;c thit b in t, in lnh.</p>\r\n<p>- Sa cha m&aacute;y git, m&aacute;y iu h&ograve;a, b&igrave;nh n&oacute;ng lnh, m&aacute;y bm nc &hellip; H&atilde;y nhc m&aacute;y l&ecirc;n v&agrave; gi ngay cho theo s in thoi: 0986 768 660 ch&uacute;ng t&ocirc;i s c&oacute; mt ch sau 30 ph&uacute;t.</p>\r\n<p><strong>Ch  bo h&agrave;nh:</strong></p>\r\n<p>- Tt c c&aacute;c m&aacute;y &atilde; c sa cha u c d&aacute;n tem hoc cung cp phiu bo h&agrave;nh v ch&iacute;nh s c m&agrave; ch&uacute;ng t&ocirc;i &atilde; sa trong v&ograve;ng 03 th&aacute;ng.</p>\r\n<p>- Khi kh&aacute;ch h&agrave;ng mua thit b mi ca ch&uacute;ng t&ocirc;i s t&iacute;nh thi hn bo h&agrave;nh ca thit b theo h&atilde;ng sn xut.</p>\r\n<p>- Nu kh&aacute;ch h&agrave;ng mua thit b c ca ch&uacute;ng t&ocirc;i cung cp v&agrave;o tng loi sn phm v&agrave; cht lng qu&yacute; kh&aacute;ch s nhn c phiu bo h&agrave;nh thit b &iacute;t nht trong v&ograve;ng 03 th&aacute;ng.</p>\r\n<div align="right">Theo <span style="font-style: italic;">Tui tr</span></div>', '', '', '89252359.jpg', '89252359_120x80.jpg', 1, 1, 1312537452, 1368086940, 7),
(25, 0, 0, 'Khu Du Lch, Vui Chi', 'Game', 'khu-du-lich-vui-choi', '', '', '', '', '', '02653937.jpg', '02653937_120x80.jpg', 6, 1, 1368241113, 0, 0),
(18, 0, 0, 'Trung C Cao Cp', '', 'trung-cu-cao-cap', '', '', '<div style="font-weight: normal; text-align: left;" align="right"><br />\r\n<div class="about_detail">\r\n<p>&nbsp;Lp t mi h thng in, nc cho h gia &igrave;nh, c quan vn ph&ograve;ng.</p>\r\n<p><br />- Thi c&ocirc;ng c&ocirc;ng tr&igrave;nh cho c&aacute;c h thng in nc ln nh nh&agrave; trung c, c&aacute;c t&ograve;a cao c, bit th.<br /><br />-&nbsp;<strong>Sa cha in nc</strong>: sa ng nc, lp t ng nc mi, thay van v&ograve;i nc.<br /><br />- Sa cha in mch: in ch&igrave;m, in ni, in chp, ch&aacute;y, mt in, i li d&acirc;y mi.<br /><br />-&nbsp;<strong>Sa cha m&aacute;y bm nc</strong>&nbsp;: m&aacute;y kh&ocirc;ng l&ecirc;n, v ng nc, thay m&aacute;y mi, thay li ng ng, cun li m&aacute;y.<br /><br />- Sa cha thit b nh&agrave; tm : Sen tm, v&ograve;i chu, st, lavabo, bt.<br /><br />- Sa cha b&igrave;nh n&oacute;ng lnh : mt in, nc kh&ocirc;ng n&oacute;ng, r&ograve; in, lp th&ecirc;m chng git, thay b&igrave;nh mi.<br /><br />- Sa cha h thng in thp s&aacute;ng, thay mi b&oacute;ng in, d&acirc;y in.<br /><br />- Sa cha, khc phc s c h thng in ngm, c&aacute;p quang.<br /><br />- Sa cha c&aacute;c loi m&aacute;y bin &aacute;p, n &aacute;p, c&ocirc;ng t, b chuyn i in nng, qut in.<br /><br /><img style="font-size: 12px; line-height: 1.5;" src="http://xaydungnamsao.com/hoanghung/5/images/5-electrical-services-sydney.jpg" alt="sa cha in nc" /><strong><img src="http://xaydungnamsao.com/home/library/module_new/Sua-chua-dien-nuoc1359562011_s250.jpg" alt="sa cha in nc" /></strong></p>\r\n<p><span><strong>C&aacute;c bc tin h&agrave;nh sa cha in nc</strong></span><br /><br /><strong>Bc 1.</strong><br /><br />Tip nhn th&ocirc;ng tin t kh&aacute;ch h&agrave;ng, ph&acirc;n t&iacute;ch s l&yacute; ph&acirc;n loi c&aacute;c hng mc theo y&ecirc;u cu ca kh&aacute;ch h&agrave;ng.<br /><br /><strong>Bc 2.</strong><br /><br />C&ocirc;ng ty s c c&aacute;n b k thut (CBKT) gp kh&aacute;ch h&agrave;ng theo &uacute;ng cp  c&ocirc;ng vic y&ecirc;u cu, thi gian v&agrave; a im &atilde; hn. CBKT s kho s&aacute;t, ph&acirc;n t&iacute;ch, t vn  ph&acirc;n cp  c&ocirc;ng vic, l&ecirc;n k hoch b&aacute;o gi&aacute;, thi c&ocirc;ng theo tha thun ca &ocirc;i b&ecirc;n. B&aacute;o gi&aacute; s c gng c gi trong ng&agrave;y hoc chm nht v&agrave;o h&ocirc;m sau qua fax, email, gi trc tip cho kh&aacute;ch h&agrave;ng.<br /><br /><strong>Bc 3.</strong><br /><br />Sau b&aacute;o gi&aacute; l&agrave; vic trao i tha thun gia &ocirc;i b&ecirc;n  i n thng nht v gi&aacute;, cht liu cho tng hng mc, bin ph&aacute;p thi c&ocirc;ng, tin  thi c&ocirc;ng, hp ng thi c&ocirc;ng,... &nbsp;<br /><br /><strong>Bc 4.</strong><br /><br />Tin h&agrave;nh trin khai thi c&ocirc;ng. C&ocirc;ng ty t chc c&ocirc;ng nh&acirc;n v&agrave; CBKT  sa cha theo hp ng. Ch nh&agrave; c ngi th&acirc;n gi&aacute;m s&aacute;t c&ocirc;ng vic cng nh kim so&aacute;t t&agrave;i sn trong nh&agrave;. &ocirc;i b&ecirc;n kt hp  c&ocirc;ng vic sa cha in nc th&agrave;nh c&ocirc;ng tt p trong thi gian sm nht theo y&ecirc;u cu ca bn.&nbsp;<br /><br /><strong>Bc 5.</strong><br /><br />Trong qu&aacute; tr&igrave;nh thi c&ocirc;ng nu c&oacute; thay i ph&aacute;t sinh tng hay gim gia ch vui l&ograve;ng x&aacute;c nhn c th c&ocirc;ng vic  thun tin cho vic l&agrave;m ph lc hp ng v&agrave; quyt to&aacute;n thanh l&yacute; hp ng c su&ocirc;n s ch&iacute;nh x&aacute;c. &nbsp;&nbsp;<br /><br /><strong>Bc 6 :</strong><br /><br />Ch  hu m&atilde;i, b&agrave;o h&agrave;nh in nc: s t&ugrave;y thuc v&agrave;o cp  c&ocirc;ng vic m&agrave; &ocirc;i b&ecirc;n k&yacute; kt ch  bo h&agrave;nh cho c&ocirc;ng vic sa cha &oacute;.&nbsp;Sau khi b&agrave;n giao a v&agrave;o sa dng nu c&oacute; vn  g&igrave; tr ngi cn khc phc gii quyt gia ch li&ecirc;n h ngay c&ocirc;ng ty  c phc v trong ng&agrave;y cho qu&iacute; kh&aacute;ch. Nu kh&ocirc;ng h&agrave;i l&ograve;ng bt c vn  g&igrave; ch nh&agrave; li&ecirc;n h  c gii quyt tha &aacute;ng.</p>\r\n</div>\r\n<div>\r\n<div id="fb-root" class=" fb_reset">\r\n<div style="text-align: left;">&nbsp;</div>\r\n<div>&nbsp;</div>\r\n</div>\r\n<div class="fb-comments fb_iframe_widget" data-href="http://xaydungnamsao.com/home/Xay-dung/Sua-nha_Sua-chua-dien-nuoc/vn" data-width="700" data-num-posts="2">&nbsp;</div>\r\n</div>\r\nTheo <span style="font-style: italic;">VTV</span></div>', '', '', '50532182.jpg', '50532182_120x80.jpg', 3, 1, 1312537520, 1368086861, 12),
