INSERT INTO `table_news` (`id`, `id_cat`, `tinnoibat`, `ten_vi`, `ten_en`, `ten_ta`, `ten_ja`, `tenkhongdau`, `mota_vi`, `mota_en`, `mota_ta`, `mota_ja`, `noidung_vi`, `noidung_en`, `noidung_ta`, `noidung_ja`, `loaitin`, `photo`, `thumb`, `title_vi`, `title_en`, `title_ta`, `title_ja`, `keywords_vi`, `keywords_en`, `keywords_ta`, `keywords_ja`, `description_vi`, `description_en`, `description_ta`, `description_ja`, `stt`, `hienthi`, `ngaytao`, `ngaysua`, `luotxem`) VALUES
(3, 5, 0, 'Google ra mt cc knh YouTube thu ph ', 'Anh', 'i Loan', 'Nht Bn', 'google-ra-mat-cac-kenh-youtube-thu-phi', 'Ngy 9/5, hng Google  ra thng bo cho bit h va ra mt chng trnh th im, trong  cho php mt nhm i tc YouTube thu ph thu bao i vi ngi dng  truy cp vo ni dung ca h.', 'Anh', 'i Loan', 'Nht', '<p class="Normal">Tp o&agrave;n Xng du Vit Nam (Petrolimex) va c&ocirc;ng b gim 470 ng i vi mi l&iacute;t xng RON 92 b&aacute;n ra trong h thng t 12 gi ng&agrave;y 29/8. Gi&aacute; b&aacute;n l i vi mt h&agrave;ng n&agrave;y, theo &oacute; gim v&nbsp;<span>23.740 ng mt l&iacute;t.&nbsp;</span></p>\r\n<p class="Normal"><span>Du diesel 0,05S v&agrave; du ha cng c c&ocirc;ng b gim 160-180 ng, v ln lt 21.930 v&agrave; 22.070 ng mt l&iacute;t</span><span>. Trong khi &oacute;, mc gim i vi du maz&uacute;t l&agrave; 60 ng, v 18.690 ng mt kg.</span></p>\r\n<p class="Normal"><strong>Gi&aacute; b&aacute;n l xng du c Petrolimex &aacute;p dng t 12h ng&agrave;y 29/8</strong></p>\r\n<table class="tplCaption" border="0" cellspacing="0" cellpadding="3" align="center">\r\n<tbody>\r\n<tr>\r\n<td><img src="http://m.f25.img.vnecdn.net/2014/08/29/Giabanle-400-1364-1409289769.jpg" alt="Giabanle-400-1364-1409289769.jpg" data-natural-="" data-width="400" data-pwidth="480" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class="Normal">Trc &oacute;, li&ecirc;n B T&agrave;i ch&iacute;nh - C&ocirc;ng Thng &atilde; c&oacute; vn bn y&ecirc;u cu c&aacute;c doanh nghip u mi iu chnh gim gi&aacute; c&aacute;c mt h&agrave;ng n&agrave;y. C th, gi&aacute; b&aacute;n hin h&agrave;nh i vi xng RON 92 &atilde; vt mc c s 464 ng mi l&iacute;t. Do vy, doanh nghip c y&ecirc;u cu iu chnh  mc b&aacute;n l kh&ocirc;ng cao hn 23.746 ng mt l&iacute;t.&nbsp;<span>Gi&aacute; b&aacute;n du diezel, madut v&agrave; du ha cng vt mc c s 52-151 ng mi l&iacute;t, kg.&nbsp;</span></p>', '<p>Anh</p>', '<p>&agrave;i Loan</p>', '<p>Nht Bn</p>', '', '72639872.jpg', '72639872_150x120.jpg', 'Vit', 'Anh', 'i Loan', 'Nht Bn 1Nht Bn', 'Vit', 'Anh', 'i Loan', 'Nht Bn', 'Vit', 'Anh', 'i Loan', 'Nht Bn', 1, 1, 1312536264, 1409300614, 3),
(26, 6, 0, 'Vit Nam', 'Anh', 'i Loan', 'Nht Bn', 'viet-nam', 'Vit Nam', 'Anh', 'i Loan', 'Nht Bn', '<p>Vit Nam</p>', '<p>Anh</p>', '<p>&agrave;i Loan</p>', '<p>Nht Bn</p>', '', '11619137.jpg', '11619137_150x120.jpg', 'Vit Nam', 'Anh', 'i Loan', 'Nht Bn', 'Vit Nam', 'Anh', 'i Loan', 'Nht Bn', 'Vit Nam', 'Anh', 'i Loan', 'Nht Bn', 1, 1, 1409129322, 1409298203, 0),
(28, 7, 0, 'Tiu chun ISO 001', '', '', '', 'tieu-chuan-iso-001', '', '', '', '', '<div class="block_timer_share">\r\n<div class="block_timer left txt_666"><strong><span style="font-size: 2em; line-height: 1.5;">GS Ho&agrave;ng Ch&iacute; Bo: ''K c hi v&agrave;o v tr&iacute; cp cao s l&agrave; i ha''</span></strong></div>\r\n</div>\r\n<div class="short_intro txt_666">"Nu &aacute;nh gi&aacute;, b tr&iacute; c&aacute;n b kh&ocirc;ng &uacute;ng,  lt li k c hi v&agrave;o cng v cp cao s rt c&oacute; hi cho s ph&aacute;t trin ca ng, li &iacute;ch v&agrave; quyn li ca d&acirc;n", GS Ho&agrave;ng Ch&iacute; Bo, Ch tch Hi ng Khoa hc, Vin Khoa hc nghi&ecirc;n cu nh&acirc;n t&agrave;i - nh&acirc;n lc n&oacute;i.</div>\r\n<div class="relative_new">\r\n<ul class="list_news_dot_3x3_300">\r\n<li><a href="http://vnexpress.net/tin-tuc/thoi-su/di-chuc-ho-chu-tich-quan-chung-chi-yeu-men-nguoi-co-dao-duc-3035813.html">Di ch&uacute;c H ch tch: ''Qun ch&uacute;ng ch y&ecirc;u mn ngi c&oacute; o c''</a></li>\r\n</ul>\r\n</div>\r\n<div id="left_calculator">\r\n<div class="fck_detail width_common">\r\n<p class="Normal"><em>- Trong di ch&uacute;c, Ch tch H Ch&iacute; Minh vit, ng phi c x&acirc;y dng bng tinh thn o&agrave;n kt t trung ng n c&aacute;c chi b, phi gi g&igrave;n nh gi g&igrave;n con ngi ca mt m&igrave;nh. Li dy y c thc hin nh th n&agrave;o trong giai on hin nay tha &ocirc;ng?</em></p>\r\n<p class="Normal"><span>- Nm nay</span>&nbsp;ch&uacute;ng ta k nim 45 nm thc hin di ch&uacute;c H Ch tch, nu t&iacute;nh t ng&agrave;y t b&uacute;t u ti&ecirc;n &atilde; l&agrave; 49 nm, ng khi xng l&atilde;nh o c&ocirc;ng cuc i mi gn 30 nm. Nhng chng ng lch s y u li&ecirc;n quan n mt vn  rt then cht l&agrave; ng v&agrave; x&acirc;y dng ng. Hc tp l&agrave;m theo di ch&uacute;c ca B&aacute;c v vn  x&acirc;y dng ng phi c bit ch&uacute; &yacute; n iu B&aacute;c nhn mnh ngay t u l&agrave; "Trong ng, t trung ng ti chi b phi gi g&igrave;n s o&agrave;n kt v&agrave; thng nht nh gi g&igrave;n con ngi ca mt m&igrave;nh". B&aacute;c cng nhn mnh, o&agrave;n kt kh&ocirc;ng ch l&agrave; truyn thng qu&yacute; b&aacute;u ca ng m&agrave; c&ograve;n ca c d&acirc;n tc Vit Nam. Nh o&agrave;n kt m&agrave; c&oacute; sc mnh, chia r th&igrave; s tht bi, suy yu.</p>\r\n<p class="Normal">iu B&aacute;c bn t&acirc;m v&agrave; lo lng l&agrave; khi ng cm quyn th&igrave; c&oacute; gi c o&agrave;n kt kh&ocirc;ng,&nbsp;<span>c quan l&atilde;nh o c&oacute; phm phi sai lm v ng li, ch trng, ch&iacute;nh s&aacute;ch hay kh&ocirc;ng? Tt c iu n&agrave;y kh&ocirc;ng ch li&ecirc;n quan n ng m&agrave; c&ograve;n nh hng n cuc sng ca nh&acirc;n d&acirc;n v&agrave; c d&acirc;n tc.</span></p>\r\n<p class="Normal">Ngh quyt trung ng 4 kho&aacute; 11 &atilde; n&oacute;i r&otilde; nhng vn  cp b&aacute;ch v x&acirc;y dng ng, trong &oacute; c&oacute; vn  suy tho&aacute;i kinh t, ch&iacute;nh tr, t tng, o c, li sng ca b phn kh&ocirc;ng nh c&aacute;n b qun l&yacute; c&aacute;c cp, k c cp cao. Trong s suy tho&aacute;i n&agrave;y, ng nhi&ecirc;n kh&ocirc;ng th kh&ocirc;ng c&oacute; s mt o&agrave;n kt.&nbsp;</p>\r\n</div>\r\n</div>', '', '', '', '', '01678210.jpg', '01678210_150x120.jpg', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 1409366113, 1409367555, 0);
