(26, 0, 0, 'Th', '', '', '', 'thu', 'Bn bit th p, hm 2.5m ng Trn Xun Son, F. Tn King, Q7 05-08-2011 11:25:18 AM // 2 lt xem Bn nh p 1 lng c hm 2.5m ng Trn Xun Son, F. Tn King, Q7,DT: 4x10, hng ng Bc, nh p gm 1PN ln, 1wc, tng trt  thong v sut. Thch hp gia nh tr mi ra ring. SH, N chnh. V tr nh cch ng chnh 50m. Cch TTQ1 khon 10 pht. Cch cu Nguyn Vn C 500m. Gi bn 1.25 t.', '', '', '', '<p><span>B&aacute;n bit th p, hm 2.5m ng Trn Xu&acirc;n Son, F. T&acirc;n King, Q7&nbsp;</span><span><em>05-08-2011 11:25:18 AM // 2 lt xem</em></span><span>&nbsp;B&aacute;n nh&agrave; p 1 lng &uacute;c hm 2.5m ng Trn Xu&acirc;n Son, F. T&acirc;n King, Q7,DT: 4x10, hng &ocirc;ng Bc, nh&agrave; p gm 1PN ln, 1wc, tng trt  tho&aacute;ng v&agrave; sut. Th&iacute;ch hp gia &igrave;nh tr mi ra ri&ecirc;ng. SH, N ch&iacute;nh. V tr&iacute; nh&agrave; c&aacute;ch ng ch&iacute;nh 50m. C&aacute;ch TTQ1 khon 10 ph&uacute;t. C&aacute;ch cu Nguyn Vn C 500m. Gi&aacute; b&aacute;n 1.25 t.</span></p>', '', '', '', '', '12682703.jpg', '12682703_200x110.jpg', '', '', '', '', '', '', '', '', '', '', '', '', 1, 1, 1409326926, 0, 0),
(25, 0, 0, 'Vi MU, Sir Alex l hp ng th k', 'Vi MU, Sir Alex l hp ng th k', 'i Loan', 'Nht Bn', 'voi-mu-sir-alex-la-hop-dong-the-ky', 'Sir Alex k nhiu hp ng thnh cng, nhng chnh ng mi l bn hp ng tt nht ca MU.', 'Vi MU, Sir Alex l hp ng th k', 'i Loan', 'Nht Bn', '<p><span>Sir Alex k&yacute; nhiu hp ng th&agrave;nh c&ocirc;ng&nbsp;</span></p>\r\n<p><span> nhng ch&iacute;nh &ocirc;ng mi l&agrave; bn hp ng tt nht ca MU.</span></p>\r\n<p>Khi&nbsp;<strong>Sir Alex</strong>&nbsp;tuy&ecirc;n b gii ngh, Eric Cantona, ngi c cho l&agrave; bn hp ng th&agrave;nh c&ocirc;ng nht di triu i Ferguson, bo rng: &ldquo;C&oacute; th c&oacute; mt Cantona, Giggs, Scholes hay Ronaldo th hai. Nhng Sir Alex l&agrave; duy nht trong lch s Manchester United&rdquo;. Cantona kh&ocirc;ng h qu&aacute; li. Nu 26 nm trc nhng nh&acirc;n vt c&oacute; m&aacute;u mt nht ti Old Trafford kh&ocirc;ng ch ng mi Ferguson, lch s MU c&oacute; th &atilde; i theo hng rt kh&aacute;c.</p>\r\n<p>K t sau khi Sir Matt Busby v hu, MU &atilde; ch&igrave;m trong 15 nm en ti vi 4 i HLV. Ngi cui c&ugrave;ng l&agrave; Ron Atkinson thm ch&iacute; &atilde; xin t chc 1 nm trc khi Ferguson ng &yacute; ti Old Trafford. Th&agrave;nh t&iacute;ch bt b&aacute;t ca i b&oacute;ng ch thay i khi Ch tch Martin Edwards, ngi th&iacute;ch b&oacute;ng bu dc hn b&oacute;ng &aacute; v&agrave; &atilde; tng c&oacute; &yacute; nh b&aacute;n CLB v&agrave;o nm 1984, quyt nh phi ci t bng gh hun luyn  a MU tho&aacute;t khi vng b&ugrave;n.</p>\r\n<p><img class="news-image" src="http://img-hcm.24hstatic.com:8008/upload/2-2013/images/2013-05-10/1368201620-bong-da-ferguson2.jpg" alt="Vi MU, Sir Alex l&agrave; hp ng th k, B&oacute;ng &aacute;, Sir Alex Ferguson nghi huu, Sir Alex Ferguson ve huu, Sir Alex Ferguson chia tay mu, Sir Alex nghi huu, Sir Alex ve huu, Sir Alex chia tay MU, Sir Alex Ferguson giai nghe, Sir Alex giai nghe, Alex Ferguson nghi huu, Alex Ferguson ve huu, Alex Ferguson chia tay MU, Alex ferguson, Sir Alex, MU, bong da, bongda, bong da so, tin bong da, tin chuyen nhuong, bong da 24h, bao, bao bong da" /></p>\r\n<p>Ferguson n khi MU ang gp kh&oacute; khn</p>\r\n<p>Cuc hp cp cao gia Edwards vi c&aacute;c cng s th&acirc;n cn Mike Edelson, Maurice Watkins v&agrave; Sir Bobby Charlton v&agrave;o th&aacute;ng 11 nm 1986 &atilde; i n thng nht rng Alex Ferguson l&agrave; s la chn s 1 cho chic gh n&oacute;ng. Fergie khi &oacute; l&agrave; mt HLV tr xut sc ca Vng quc Anh, ngi &atilde; a Aberdeen chinh phc mt lot danh hiu ti Scotland v&agrave; ph&aacute; v th song m&atilde; gia Celtic v&agrave; Rangers. Mc d&ugrave; vy, Edwards kh&ocirc;ng chc Ferguson mun n mt i b&oacute;ng &atilde; sa s&uacute;t thm hi nh MU, nht l&agrave; khi &ocirc;ng tng thng thng t chi c Tottenham v&agrave; Arsenal v&agrave;o m&ugrave;a H&egrave; nm 1986.</p>\r\n<p>Nhng ri khi tt c b su MU ln li n gp Ferguson sau mt cuc hn b&iacute; mt qua in thoi, v HLV ngi Glasgow &atilde; gt u ng &yacute;. Rt nhanh ch&oacute;ng, 72 gi sau &oacute;, bn hp ng c ho&agrave;n tt v&agrave; Ferguson tr th&agrave;nh HLV tip theo c k vng s ni tip th&agrave;nh c&ocirc;ng ca Sir Matt Busby. Ng&agrave;y 6/11/1986, Alex nhm chc, m ra thi k 26 nm i th&agrave;nh c&ocirc;ng trong lch s Qu . &Ocirc;ng vt qua c nhng k t&iacute;ch ca huyn thoi Busby  tr th&agrave;nh chin lc gia v i nht mi thi i ca MU.</p>\r\n<p><img class="news-image" src="http://img-hcm.24hstatic.com:8008/upload/2-2013/images/2013-05-10/1368201620-bong-da-ferguson.jpg" alt="Vi MU, Sir Alex l&agrave; hp ng th k, B&oacute;ng &aacute;, Sir Alex Ferguson nghi huu, Sir Alex Ferguson ve huu, Sir Alex Ferguson chia tay mu, Sir Alex nghi huu, Sir Alex ve huu, Sir Alex chia tay MU, Sir Alex Ferguson giai nghe, Sir Alex giai nghe, Alex Ferguson nghi huu, Alex Ferguson ve huu, Alex Ferguson chia tay MU, Alex ferguson, Sir Alex, MU, bong da, bongda, bong da so, tin bong da, tin chuyen nhuong, bong da 24h, bao, bao bong da" /></p>\r\n<p>Edwards (tr&aacute;i)&nbsp;&atilde; rt ki&ecirc;n nhn vi Ferguson</p>\r\n<p>Tuy nhi&ecirc;n, th&agrave;nh c&ocirc;ng n vi Ferguson kh&ocirc;ng h d d&agrave;ng. 4 nm u  Old Trafford l&agrave; thm ha thc s. c bit l&agrave; nm 1989, khi Ferguson b ch&iacute;nh c&aacute;c CV nh&agrave; quay lng, &ocirc;ng &atilde; gi &oacute; l&agrave; &ldquo;nm en ti nht trong s nghip&rdquo;. Nhng mi t&igrave;nh MU &ndash; Ferguson vn vt qua c s&oacute;ng gi&oacute;, nh s ki&ecirc;n nh v&agrave; s&aacute;ng sut ca BL i b&oacute;ng, m&agrave;  &acirc;y ngi &oacute;ng vai tr&ograve; quyt nh l&agrave; Ch tch Martin Edwards. S ki&ecirc;n nhn ca Edwards &atilde; c n &aacute;p xng &aacute;ng v&agrave; d nhi&ecirc;n n&oacute; &atilde; gi&uacute;p Ferguson to n&ecirc;n mt trong nhng  ch b&oacute;ng &aacute; h&ugrave;ng mnh nht th gii.<br /><br />Nu nh Ferguson c&oacute; nh hng cc ln n s nghip ca mt lot nhng ng&ocirc;i sao h&agrave;ng u, nh Cantona, Giggs, Keane, Scholes, Beckham, Rooney, Ronaldo&hellip; th&igrave; kh&ocirc;ng nghi ng g&igrave; na, Maritn Edwards ch&iacute;nh l&agrave; ngi c&oacute; nh hng ln nht n s nghip vinh quang ca&nbsp;<span style="text-decoration: underline;">Sir Alex</span>. Nu ng&agrave;y y Edwards kh&ocirc;ng t&igrave;m n hoc sm tng c Ferguson khi Old Trafford, th&igrave; lch s b&oacute;ng &aacute; Anh v&agrave; ch&acirc;u &Acirc;u cng nh th gii trong 26 nm ri qua hn &atilde; kh&aacute;c rt nhiu.</p>\r\n<p><span>&nbsp;</span></p>', '<p>Vi MU, Sir Alex l&agrave; hp ng th k</p>', '<p>&agrave;i Loan</p>', '<p>Nht Bn</p>', '', '84071951.jpg', '84071951_200x110.jpg', 'Vi MU, Sir Alex l hp ng th k', 'Vi MU, Sir Alex l hp ng th k', 'i Loan', 'Nht Bn 1Nht Bn', 'Vi MU, Sir Alex l hp ng th k', 'Vi MU, Sir Alex l hp ng th k', 'i Loan', 'Nht Bn', 'Vi MU, Sir Alex l hp ng th k', 'Vi MU, Sir Alex l hp ng th k', 'i Loan', 'Nht Bn', 1, 1, 1368241713, 1409326617, 2),
